
UPDATE user_schema.user SET status = 'ACTIVE' WHERE id > 0;
UPDATE user_schema.user SET status = 'BANNED' WHERE id <= trunc(random() * 100);
UPDATE user_schema.user SET status = 'ACTIVE' WHERE id >= trunc(random() * 100);
UPDATE user_schema.user SET status = 'ACTIVE' WHERE id % 2 != 0;

UPDATE user_schema.user SET image_url = CONCAT('https://randomuser.me/api/portraits/men/', trunc(random() * 100), '.jpg') WHERE gender = 'M';
UPDATE user_schema.user SET image_url = CONCAT('https://randomuser.me/api/portraits/women/', trunc(random() * 100), '.jpg') WHERE gender = 'F';

ALTER TABLE user_schema.user DROP COLUMN gender;